int main ( ) { long int swap , n , i , j ; scanf ( "%ld" , & n ) ; long int a [ n ] ; for ( i = 0 ; i < n ; i ++ ) { scanf ( "%ld" , & a [ i ] ) ; } for ( i = 0 ; i < n - 1 ; i ++ ) { for ( j = 0 ; j < n - i - 1 ; j ++ ) { if ( a [ j ] > a [ j + 1 ] ) { swap = a [ j ] ; a [ j ] = a [ j + 1 ] ; a [ j + 1 ] = swap ; } } } for ( i = 0 ; i < n ; i ++ ) { printf ( "%ld\n" , a [ i ] ) ; } return 0 ; }